Buy shares from a token owner issue. If there is no issue, or the issue state is not
open, reverts with [pr20]. Attempt to buy more shares than available reverts with [pr21].
The msg.sender must pay a purchase fee, as well as the share price. The purchase fee is deducted from the
share price before the owner is paid.
If this call results in the successful purchase of all remaining shares, the issue state
is set to OFFERING_STATE_FULFILLED.
@param tokenOwner   Address of token owner
@param tokenId      ID of token for issue
@param numShares    Number of shares to buy

